import { Input } from "@chakra-ui/input";
import { VStack } from "@chakra-ui/layout";
import React from "react";

function SignUp() {
  const [name, setName] = useState("");
  return (
    <VStack spacing="5px">
      <FormControl>
        <FormLabel></FormLabel>
        <Input placeholder="Enter your Name"></Input>
      </FormControl>
    </VStack>
  );
}

export default SignUp;
